--  DDL for Procedure CADASTRAR_SUGESTAO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE NONEDITIONABLE PROCEDURE "CIDCARIOCA"."CADASTRAR_SUGESTAO" 
(

v_cpf VARCHAR2,
v_id_sugestao IN sugestao.id_sugestao%type,
v_titulo IN sugestao.titulo%type,
v_desc IN sugestao.descricao%type,
v_status IN sugestao.status%type,
v_id_categoria IN sugestao.id_categoria%type,
v_data IN sugestao.data%type,
v_return OUT number

)

IS
v_validacao number;

BEGIN
v_validacao := FN_LIMITE_SUGESTAO (v_cpf);
    IF v_validacao = 0 THEN
        v_return := 0;
        dbms_output.put_line('Atenção: Usuário inserido na BlackList');
        Raise_Application_Error (-20000, 'Limite de 3 três sugestões excedido. Usuário bloqueado temporariamente');
        

    ELSE 
        v_return := 1;

    END IF;
END;

/
--------------------------------------------------------
--  DDL for Procedure PR_ATUALIZA_STATUS
--------------------------------------------------------
set define off;

  CREATE OR REPLACE NONEDITIONABLE PROCEDURE "CIDCARIOCA"."PR_ATUALIZA_STATUS" 
IS
	cursor cmetricas is
    SELECT s.status, s.id_sugestao, m.positivo, m.negativo FROM sugestao s 
    INNER JOIN metricas m ON s.id_sugestao = m.id_sugestao;

BEGIN
	for x in cmetricas loop
    IF x.positivo > 100 then
		update sugestao set status = 'APROVADO'
        where sugestao.id_sugestao = x.id_sugestao;
    elsif x.negativo > 100 then 
        update sugestao set status = 'REPROVADO'
        where sugestao.id_sugestao = x.id_sugestao;
    else
		update sugestao set status = 'EM ANALISE'
        where sugestao.id_sugestao = x.id_sugestao;
	   end if;
	end loop;

EXCEPTION
  When others then
    DBMS_OUTPUT.PUT_LINE('OCORREU UM ERRO! POR FAVOR TENTE MAIS TARDE');
END;

/
--------------------------------------------------------
--  DDL for Procedure PR_LIMITE_SUGESTAO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE NONEDITIONABLE PROCEDURE "CIDCARIOCA"."PR_LIMITE_SUGESTAO" (
v_cpf_in in VARCHAR2)
IS
v_qry number;
BEGIN
SELECT count(*) INTO v_qry
    FROM sugestao
    WHERE data = 
                (SELECT current_date from dual) AND cpf = v_cpf_in;
    IF v_qry >= 3 THEN 
       Raise_Application_Error (-20343, 'Limite de 3 três sugestões excedido. Usuário bloqueado temporariamente');
    END IF;
END;

