--------------------------------------------------------
--  DDL for Function CPF_BLIST
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE FUNCTION "CIDCARIOCA"."CPF_BLIST" 
   ( vcpf_in IN varchar2 )
   RETURN varchar2
IS
   cmotivo varchar2(100);
   naoencontrado exception;

   CURSOR c1
   IS
        SELECT motivo 
        FROM black_list
        WHERE cpf = vcpf_in;

BEGIN

   OPEN c1;
   FETCH c1 INTO cmotivo;

   IF c1%notfound THEN
      RAISE naoencontrado;
   END IF;

   CLOSE c1;
RETURN cmotivo;

EXCEPTION
  WHEN naoencontrado THEN
    DBMS_OUTPUT.PUT_LINE('CPF NÃO ENCONTRADO');
END;

/
--------------------------------------------------------
--  DDL for Function FN_LIMITE_SUGESTAO
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE FUNCTION "CIDCARIOCA"."FN_LIMITE_SUGESTAO" (
v_cpf_in IN VARCHAR2)
return number
IS
v_qry number;

BEGIN

v_qry := 0;

SELECT count(*) INTO v_qry
    FROM sugestao
    where trunc(data) = trunc(current_date) AND
    (cpf = v_cpf_in); 
    IF v_qry >= 3 THEN 
        COMMIT;
        RETURN 0;

    ELSE
        RETURN 1;
       -- Raise_Application_Error (-20343, 'Limite de 3 três sugestões excedido. Usuário bloqueado temporariamente');
    END IF;
    
END;

/
